script: |
  super -f tsv -I q449.sql | sort > q449.out

vector: true

inputs:
  - name: q449.sql
    data: |
      SELECT DISTINCT + - COUNT ( * ) + + - 80 AS col1 FROM tab1 AS cor0 WHERE + 25 IN ( + 86 / - - col2, col1, + + col1 * + ( - col1 ) + + + 47 + + - col2 - 49 * col2 * col2 );
  - name: tab1

outputs:
  - name: q449.out
    data: |
      -80
